import { Link } from 'react-router-dom'
import Button from 'react-bootstrap/Button'
import Card from 'react-bootstrap/Card'

function Productos(props) {
  return (
    <div>
      <Card className="mr-2 mt-2 mb-2" style={{ width: '20rem' }}>
        <Card.Body>
          <Card.Title>{props.productos.data().name}</Card.Title>
          <Card.Img src={props.productos.data().img} style={{ width: '20rem' }}></Card.Img>
          <Card.Text>{props.productos.data().price}</Card.Text>          
          <Link to={"/productos/" + props.productos.id}><Button className="mr-1" variant="primary">Ver</Button></Link>
          <Link to={"/productos/editar/" + props.productos.id}><Button variant="primary">Editar</Button></Link>
        </Card.Body>
      </Card>
    </div>
  );
}

export default Productos;
